import React,{Component} from 'react';
class Row extends Component{
constructor(someProp) {
    super();
    this.state={items:[],rows:[],idata:['A'],myprop:someProp}
    this.rowgen=this.rowgen.bind(this);  
    }
rowgen(){
    var myrows=[];
    var temp;
    console.log("From row",this.props.idata)
    for(var j=0;j<this.props.allatt.length;j++){
        var flag=false;
        //console.log(this.props.data[j])
        for(var i=0;i<this.props.data.length;i++){
            if(this.props.allatt[j]==this.props.data[i]){ flag=true; } 
        }
        if(flag==true){
            temp=<rect key={j} fill="#c994c7" x={j*18} y={0} width='18' height="18" strokeWidth=".1" stroke="black" > </rect>;
        }
        else{
            temp=<rect key={j} fill="#f0f0f0" x={j*18} y={0} width='18' height="18" strokeWidth=".1" stroke="black" > </rect>;
        }
        myrows.push(temp);
    }
    this.setState({rows:myrows})
}
componentDidMount() {
    this.rowgen()
}
render(){
    const width = 960;
    const height = 16;
return(
<div>
    <div className="Table">
        <div className="Row">
            <div className="Cell">
            {this.props.dataset}
            </div>
            <div className="Cell">
            <svg width={width} height={height}> 
            {
            this.state.rows
            }
            </svg>
            </div>
        </div>
    </div> 
</div>
)
}}
export default Row;
